import React, { Component } from 'react';
import {
  Row,
  Col,
  FormGroup
 } from 'reactstrap'

export default class ContactUs extends Component {
  constructor(props){
    super(props)
    this.state = {
        form: {
            subject: "",
            email_address: "",
            message: ""
        },
    }
  }

  localSubmit = () => {

  }

  onChange = (e) => {
      const{form} = this.state
      const{name,value} = e.target
      form[name] = value
      this.setState({form})
  }
  render() {
    const{form} = this.state
    const{subject, email_address, message} = form
    return (
      <section id="contact">
        <div className="form-board form-contact">
          <h1 className="headerFont headerStyle glow">Contact Me</h1>

          <div className="form-group">
            <label className="col-form-label label-color" for="inputDefault">Subject</label>
            <input name="subject" value = {subject} type="text" className="form-control" placeholder="Subject" id="inputDefault" onChange = {this.onChange} />
          </div>

          <div className="form-group">
            <label for="exampleInputEmail1" className="label-color">Return Email</label>
            <input name="email_address" value = {email_address} onChange = {this.onChange} type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Email" />
          </div>

          <div className="form-group">
            <label className="col-form-label label-color" for="inputDefault">Message</label>
            <textarea name="message" rows="5" columns="10" value = {message} type="text" className="form-control" placeholder="Message" id="inputDefault" onChange = {this.onChange} />
          </div>
          <br />
          <button className="submit-button" onClick={this.localSubmit} type="submit" className="btn btn-primary contactButton" style = {{backgroundColor: "#FF6E86"}}>Submit</button>
        </div>
      </section>
    );
  }
}
